import React from 'react'

export default function NewsNotifications() {
    return (
        <div>
            PÄIVÄN TIMANTTI: Tutkija kertoo: Näin sota näkyy meissä edelleen
            PÄIVÄN TIMANTTI: Harriet Robb tajusi avioliiton taloudelliset hyödyt ja kosi - Näin hän säästäisi aviopuolisona 19 200 euroa
            MAINOS: Faktoille on nyt suurempi tarve kuin koskaan - tutustu Hesariin 2 viikkoa maksutta
        </div>
    )
}
